import api from "../../services/api";

// import { Container } from './styles';

export default class Home extends Component {
  componentDidMount() {
    this.loadAds();
  }

  loadAds = async () => {
    const response = await api.get("/ads");
    console.log(response);
    return (<h2>{{response}}</h2>)
  };

  render() {
    <div>
      {this.loadAds()}
    </div>
  }
}
